import * as React from 'react';
import { useContext } from 'react';
import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';

export default function UsernamesList(props:{list:{name:string, price:string}[]}) {
    
  const [selectedIndex, setSelectedIndex] = React.useState(0);

  const handleListItemClick = (
    event: React.MouseEvent<HTMLDivElement, MouseEvent>,
    index: number,
  ) => {
    setSelectedIndex(index);
  };

  return (
    // <Box sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
      <div>
      <Divider />
      <List aria-label="usernames list" sx={{display: "inline-block", width: "20%"}}>
        {props.list.map((item, index)=> <ListItemButton
          selected={selectedIndex === index}
          onClick={(event) => handleListItemClick(event, index)}
          sx={{justifyContent: "space-between"}}
        >
          <ListItemText primary={item.name} secondary={item.price} sx={{display:"contents"  }} />
        </ListItemButton>)}
      </List>
      </div>
    /* </Box> */
  );
}
